import React from 'react';
import {
    Typography,
    Container
} from '@material-ui/core'
import './Home.css'


function Home() {
    return(
      <>
        <Container className="main" maxWidth="lg">
            <Typography variant="h1">
                Pipocando
            </Typography>
        </Container>
      </>  
    );
  }
  
  export default Home;
